import React from 'react';

import ResponsiveEmbed from 'react-bootstrap/ResponsiveEmbed';
import Navbar from 'react-bootstrap/Navbar';
const Quick = () => {
  return (
    <>
      <div class="container">
        <h2>퀵 서비스</h2>
        <Navbar.Brand href="https://unipass.customs.go.kr/csp/index.do?method=selectEximXchgList">
          관세환율
        </Navbar.Brand>
      </div>

      <div style={{ width: 660, height: 'auto' }}>
        <ResponsiveEmbed aspectRatio="16by9">
          <embed type="image/svg+xml" src="../images/home3.png" />
        </ResponsiveEmbed>
      </div>
    </>
  );
};

export default Quick;
